import { BrowserRouter as Router, Route } from "react-router-dom";
import "./App.css";

import AddDepartment from "./components/pages/department/AddDepartment";
import DepartmentList from "./components/pages/department/DepartmentList";
import EditDepartment from "./components/pages/department/EditDepartment";

import EmployeeList from "./components/pages/employee/EmployeeList";
import AddEmployee from "./components/pages/employee/AddEmployee";
import EditEmployee from "./components/pages/employee/EditEmployee";

import Container from "./components/navigation/Container";

function App() {
  return (
    <div className="container">
      <br />
      <h5>Employee Crud Application Using Django, React and Mongodb </h5>
      <hr />
      <br />
      <Container />

      <Router>
        <div>
          <Route exact match path="/" component={Container} />

          <Route path="/all_department" component={DepartmentList} />
          <Route path="/add_department" component={AddDepartment} />
          <Route path="/update_department/:id" component={EditDepartment} />

          <Route path="/all_employee" component={EmployeeList} />
          <Route path="/add_employee" component={AddEmployee} />
          <Route path="/update_employee/:id" component={EditEmployee} />
        </div>
      </Router>
    </div>
  );
}

export default App;
